import React from "react";
import { Col, Button, Card } from "react-bootstrap";

function Project(prop) {
  return (
    <React.Fragment>
      <Col md={4} className="work-items">
        <p>{prop.name}</p>
        <Img
          className="work-imagebox"
          src={prop.image}
          alt="Home Page of Dinner and a Show."
        />
        <Button
          href={prop.deployed}
          className=""
          target="_blank"
        >
          Deployed
        </Button>
        <Button
          href={prop.repo}
          className=" "
          target="_blank"
        >
          Git-Repo
        </Button>
      </Col>
    </React.Fragment>
  );
}

export default Project;
